import React from 'react';
import './Footer.css';
import footer_logo from '../Assets/logo_big.png';
import instagram_icon from '../Assets/instagram_icon.png';
import pintester_icon from '../Assets/pintester_icon.png';
import whatsapp_icon from '../Assets/whatsapp_icon.png';

const Footer = () => {
  return (
    <div className='Footer'>
      <div className='footer-logo'>
        <img src={footer_logo} alt='' />
        <p>Agriculture Portal</p>
      </div>
      <ul className='footer-links'>
        {/* Your list items */}
      </ul>
      <div className='footer-social-icon'>
        <div className='footer-icons-container'>
          <img src={instagram_icon} alt='' />
        </div>
        <div className='footer-icons-container'>
          <img src={pintester_icon} alt='' />
        </div>
        <div className='footer-icons-container'>
          {/* Adding the link to WhatsApp */}
          <a href='https://www.iloveimg.com/download/1dclzs1c7820g87y8h9fhpd6hrm8z3q0nqvccr73mhtf6yqnrlc7lytlmz29q5p1gbcvj1f5s01m13lrmn9mbx7lw92c9118zb9A1tk6ctf88gvjbxk6c1chAA4qthf66nk6r53fp8kvf2jAplqm772hvqlxqjl2j5l7zcAsxhncbwnf7sv1/2' target='_blank' rel='noopener noreferrer'>
            <img src={whatsapp_icon} alt='' />
          </a>
        </div>
      </div>
      <div className='footer-copyright'>
        <hr />
        <p>Copyright @2023 - All Rights Reserved.</p>
      </div>
    </div>
  );
};

export default Footer;
